'use strict';(function(){const b={cache:!0};b.doc={id:'id',field:['title','content'],store:['title','href','section']};const a=FlexSearch.create('balance',b);window.bookSearchIndex=a,a.add({id:0,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/2021-04%E5%AD%A6%E4%B9%A0%E8%AE%A1%E5%88%92/',title:"学习计划",section:"自我提升",content:"  Java 消息中间件 RabbitMq 和 kafka (建议学习RabbitMq)\n  web socket or spring socket\n  springboot (spring cloud考虑)\n  redis (深入使用)\n  mysql 这次复习以往 突破 存储和锁 如行锁\n  java 并发(深入)\n  nio netty\n  "}),a.add({id:1,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/git_andsower/',title:"git出现的问题",section:"解决问题",content:"收集 git 出现的问题\n"}),a.add({id:2,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/idea/',title:"idea出现的问题",section:"解决问题",content:"收集 idea出现的问题\n"}),a.add({id:3,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/maven/',title:"maven出现的问题",section:"解决问题",content:"收集 maven出现的问题\n"}),a.add({id:4,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/visual_studio_code/',title:"visual_studio_code",section:"解决问题",content:"visual studio code\n"}),a.add({id:5,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/',title:"解决问题",section:"自我提升",content:"学习的最好方式是解决问题\n"}),a.add({id:6,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/',title:"自我提升",section:"Docs",content:"时间管理、精力管理、情绪管理\r#\r\r1、时间管理\r#\r\r改变自己从认识自己开始，管理时间也是从认识时间开始。 一开始，最好的方法就是记录时间，把每天花费的时间记录下来。 就像理财一样，先记录钱花在哪里，才知道哪些钱不该花，或者少花。记事本或者手写都行，怎么方便怎么来。\n第一阶段\r#\r\r可以这样简单记录，看看大块时间用在哪里。开会（0.5）吃饭（1.0）写作（2.0）刷抖音（3.0）写代码（4.0）你看，明显是刷抖音时间长，这个可以尽量减少或避免。\n第二阶段\r#\r\r记录具体时间和具体事件。 6:00 ~ 7:00 晨练 7:00 ~ 8:00 读书写作 8:00 ~ 9:00 去上班 9:00 ~ 11:00 工作 12:00 ~ 14:00 午休 14:00 ~ 16:00 梳理积分商城 16:00 ~ 16:30 休息 16:30 ~ 19:00 综合分析竞品商场 19:30 ~ 整理主要目的，看看哪个时间做了哪些事，具体花费多少时间，后边有大用。\n第三阶段\r#\r\r清晨安排三件事很多人不喜欢记录，太麻烦，记来记去也没什么改变。任何工具如果使用起来太复杂，就会有90%的人放弃。 清晨三件事，非常简单，也是我一直在用的。每天早晨起来，就按照重要程度，把当天最需要干完的三件事完成。 我今天最需要做完的三件事： 1.工作报告整理，各个项目组进度把控，协调资源。 2.跟客户谈具体合作事项。 3.公众号文章一篇，知乎问答一篇。工作时间，把前两项搞定，业余时间把最后一项搞定。 如果还剩下时间，我就会做一些长期规划的事，明天、后天，以及未来一个月需要准备做的事。做好以上这些，就能极大提升工作效率吗，不能。 你一定遇到过这种情况，时间很充足，坐在那里，啥也干不进去。比如，一下午过去了，报告一个字没有写，有时间，没状态。遇到这种情况，不是时间出了问题，而是你的精力出了问题。\n2、精力管理\r#\r\r有一本书《精力管理》，讲了精力来源的四个方面：体能、思维、情感、意志。我跟进自己的实践和观察，体能和思维对我影响很大。 体能也是精力最基本的来源。我记得上高中那会，早上为了节省饭钱，只吃馒头和方便面。那几天上早自习感觉特别累，总爱打瞌睡。 后来，吃了两个星期实在扛不住了，又去食堂吃饭了。那时候感觉特别饿，没精神，没有想过饮食这么重要。刚刚工作那会也是，早上不吃饭，死磕一上午，中午吃得又多犯困。 整个人一天的工作状态不是特别好，还好那会年轻，用精神力扛着。现在作息规律，早上跑步、读书，吃早饭。上午一般脑子清楚，一般做一些分析类工作。 午餐之后，会溜达一会，消消食，然后午睡。下午脑子不那么灵光，有一些疲倦，会做一些总结和整理工作。 晚上吃完饭，也有一个不错的状态，会做一些有创意的工作。一句话，你一定要在状态最好的时候，做最难最复杂的事。注意自己的精神状态，太疲惫了就休息一会，磨刀不误砍柴工。死磕的状态不能持续，要养成固定的习惯。\n3、情绪管理\r#\r\r做到以上两点，已经可以称为高手了。能够利用自己的情绪，高效率完成工作更是高手中的高手。有时间、精力充沛，但还是遇到一些工作，干不下去。 人人有七情六欲，当你发现自己不喜欢一项工作的时候，怎么都干不下去。这时候心里一直抵触，然后开始怀疑自己，是不是不适合做这个；欺骗自己，明天做也没关系。如果这件事对你很重要，就一定要逼自己做下去。 有一个小技巧：给自己1个小时的放空时间，在这个时间不带着情绪做事，不考虑要做的事有没有意义，有没有帮助，能够得到什么结果。把情绪放在做事上，不放在心里，在这一刻你可以把自己暂时当作没有情感的机器。 先不要急着否定我，你可以去试试，如果真的不好用，你可以来找我。我最开始写作的时候，最多能写500字，我看别人的文章动辄几千，心态直接就不好了。坐在椅子上，一直在想1000字太长了，根本写不出来，完不成。 没有把情绪用在内容上，而是用在否定自己上，情绪低落，心态消极。\n"}),a.add({id:7,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%AE%B0%E5%BF%86/',title:"记忆方法",section:"自我提升",content:"记忆方法\r#\r\r 提高记忆的关键，在于想象和创意 编故事有助于提高记忆力  通过编故事，再加上逻辑或地点（后者更多一些）;\r编故事是加强了记忆桩之间的联系\r记忆和创造力\r#\r\r 记忆本身与创造力密不可分 ， 训练记忆力在很大程度上取决于你的创造力  要想记住毫不相关的信息和扑克牌，\r首先就要把它们变成图像。\r通过这种方式，\r那些零散的信息才可能会建立某种联系\r联想\r#\r\r利用事物间的联系通过联想进行记忆的方法。\r联想是由当前感知或思考的事物想起有关的另一事物，\r或者由头脑中想起的一件事物，又引起想到另一件事物。\r由于客观事物是相互联系的，各种知识也是相互联系的，因而在思维中，\r联想是一种基本的思维形式，是记忆的一种方法。\r联想，就是当人脑接受某一剌激时，浮现出与该刺激有关的事物形象的心理过程。\r一般来说，互相接近的事物、相反的事物、相似的事物之间容易产生联想。\r用联想来增强记忆是一种很常用的方法。\r记忆的一种主要机能就是在有关经验中建立联系，思维中的联想越活跃，经验的联系就越牢固。\r如能经常形成联想和运用联想，就可增强记忆的效果。\r联想是有规律可循的，联想的规律有接近律、类似律、对比律、因果律等，有接近联想、类似联想、对比联想、因果联想。\r  联想不仅快速，而且它还不是一个简单、一维的东西。首先，你在联想中会加入一些情感因素，甚至还没回想起一段经历，就已经产生了某种情绪。\n  一旦学会动用感情和感官，还有逻辑和创造力，来与不同事物间建立联系，你的记忆能力就会大大提高。除此之外，你还会慢慢习惯放松大脑，以最快的速度在不同事物之间建立联系。瞬间联想之所以对提高记忆力如此重要，是因为一个人在瞬间建立的联系往往是最牢靠的\n  如何在两个并无联系的单词之间建立联系\u0026ndash;记忆的关键，就在于将二者结合到一起。\n  如果没有过去的某些参照物作为参考，你就不能在两个概念( 包括单词、物体、活动等)之间建立联系。你的过去为你提供了某种经验，而正是这种经验可以帮助你由一个概念想到另一件概念。你的生活中发生的一切都像是积木中的模块，正是这一个个模块帮助你搭建了自己的人生大厦。要想在两个模块之间尽快建立联系，你需要用尽可能少的连接物来实现过渡。也就是说，要想从一件事情想到另外一件事情，最快的方式就是直接找到二者之间的联系\n   比如说我想记住两个单词：墙壁和小鸡。\r每个单词都能激发我丰富的联想，我必须找到某种连接物将两个单词连接起来。\r比如说：\r墙壁会让我想到一个相册，想找到我小时候放学后经常爬的墙等。\r随着联想越来越细致、快速，我突然想到了一个最明显的连接：一首叫\u0026lt;\u0026lt;小胖鸡\u0026gt;\u0026gt;的儿歌。\r好极了！小胖鸡坐着墙壁上，它是一个鸡蛋----而鸡蛋又是小鸡下的。\r这时我就会展开联想，想象一只小鸡坐在墙下下蛋。\r为了让这个联想更加生动，我想起了小时候我在唱歌时的样子，\r然后自然而然地想到了自己看着小鸡下蛋时吃吃发笑的情形。\r虽然我并不记得发生过这件事，但它却足以激发我的联想。\r这个过程听起来可能有些复杂、繁琐，但事实上，这在大脑中只是一瞬间发生的事情。\r链条法\r#\r\r 如何使用链条法记住5个单词 小提琴、武士、箱子、项链、雪球  首先想想你突然听到小提琴发出的悠扬乐声。\r然后看到一个武士在演奏小提琴，\r你甚至可以清楚地看到他把小提琴放到下巴下面--这武士满副盔甲，很是搞笑。\r然后你看到他脚边放了一个箱子，可能颜色很鲜艳，也可能已经很破旧了。\r你打开箱子，发现里面有一挂价值连城的钻石项链，钻石反射阳光，分外耀眼。\r最后你转过头去，突然一个雪球砸中你的脸颊，你甚至感觉到右脸有些发疼。\r记住，你越练习动用五官来加强想象，你的大脑就会越熟悉这种练习，你也就越容易记住自己想象的场景。\r  要要记住五个单词以及单词之间的顺序，需要在单词之间建立联系\n  使用链条法，关键在于上下文，我们可以把本来毫不关联的信息连接起来，将其放到一个场景中，这样它们就会变得很容易记住了。\n  你想象的东西一定要合理，或者至少应该符合逻辑。它们可以有些出奇，甚至古怪，但从理论上一定是合理或可能的。\n  在使用链条法记忆时，一定要注意你所想象的故事顺序。最简单的办法是按照顺序用这些单词编一个故事，故事本身应当有一定的逻辑性，只有这样，你才能记住单词的顺序。在回忆时忘记任何一个单词，都说明你编的故事不够清晰。如果真是这样，建议换个故事试试。\n  路径记忆法\r#\r\r  例子\n  第一个记忆桩：前门\n  第二个记忆桩：隔壁邻居家的房子\n  第三个记忆桩：公共汽车站\n  第四个记忆桩：商店\n  第五个记忆桩：停车场\n  在设计了固定的路径，并为每张扑克设定了一个具体的物体代码之后，我要做的就是把扑克放在路径中适当的记忆桩。\r比如说翻开的前5张牌是:方块6、黑桃3、梅花5、红桃8、方块4。记忆方式如下:\r我想象一架飞机(方块6)停在我家门口;\r邻居家门外有段木头(黑桃3)靠在篱笆墙上;\r在公共汽车站，我的小狗(梅花5)正在跳上跳下，冲着路过的汽车狂吠;\r商店里面，我(红桃8)正在买一份报纸;\r停车场里有一捆现金(方块4)。\r  重要:把要记忆的数据变换后放入路径中适当的记忆桩,相当于把数据嵌入记忆桩中,这也是为什么说联想是记忆中最重要的一点\n  这下我不会再记混顺序了，因为这段路径已经把每件事物都排好了位置。我用20张扑克进行测试，完全成功！连一个错误都没有。于是我决定延长这段路径，从我家大门开始，穿过村子，经过酒吧，穿过板球场，沿着一条可以看到大片绿色草坪的小路\u0026hellip;\u0026hellip;最后我的整个路径包括了52个记忆桩，正好是一幅扑克牌。\n  一条成功的路径必须满足三个条件:\n   1:记忆桩必须多样; 2:记忆桩之间的差异必须明显; 3:我与这些记忆桩必须有明显的互动。    地点就像是记忆中的锚\u0026ndash;它们可以成为我们回忆往事的参照点。我相信，如果没有这些地点，我们的思想，尤其是我们的记忆，就会变成一团乱麻，凌乱无序。\n  提高记忆能力的关键有三个:联想、地点、和想象\n  创建记忆路径库的5个秘诀\n   1:选择你非常熟悉的路径 2:选择对你比较有意义的路径 3:选择比较富于变化的路径 4:用特点路径来记忆特点事物 5:选择视角最佳的路径  想象感官训练(2)\r#\r\r 建议每天练习，直到确信自己可以在两个看似毫不相关的事物间建立生动具体的联系  方案一:	想象你手里正拿着个足球，它散发出新鲜橘子味，\r慢慢把这两个感觉汇集到一起。好了，然后想象足球是果冻做的在\r像时钟一样滴答走动，尝起来味道像巧克力。别着急，让这个形象至少在脑海里停留5分钟，尽量让它们鲜活起来。如果感觉大脑开始走神，立刻从头开始重复整个练习。\r然全熟悉第一套方案后，再进入下面的练习\r方案二:\r想象一头身上有粉点的灰色大象，它会像只猫咪一样喵喵叫，\r味道像块生姜，皮肤像是一根根刺人的荨麻，浑身散发出一股\r新鲜咖啡豆的味道。还是老样子，别着急，让这个形象在脑海里至少停留5分钟，尽量鲜活起来。\r记忆\u0026quot;自由玩耍\u0026quot; (3)\r#\r\r 词汇能引发记忆。迅速浏览一下下面的词汇，看看它们能让你想到什么。每个单词只要看一两秒即可，尽量不要去左右自己的想法，只是看着它们能让你想起什么就可以了。然后尽量去感受你所想到的形象、念头、情绪和感觉等\u0026mdash;-这可能只是一瞬间的事，也可能需要花上好几分钟。接着看下一个单词。这项训练的目的只是让你熟练使用自由联想，学会激发你的情绪和感觉。  kitten (猫咪)\rrainbow (彩虹)\rtoy (玩具)\rbirthday (生日)\rice cream (冰淇淋)\rsnow (雪)\rchurch (教堂)\rcushion (靠垫)\rsand (沙子)\rtoe nail (脚趾甲)\r 该项练习不仅能帮你回忆事件，还能帮你记住一些想法，以及伴随这些想法的情绪和感受。刚开始不要在意速度，你练习越久，速度就越快。  建立联系 (4)\r#\r\r 看看下面的单词，尽量用它们在你脑中激发出的第一反应在每一对单词之间建立联想。千万不要对这些联想做任何修改\u0026mdash;你只要放松大脑，在二者之间建立联系就可以了。这就是记忆两条不相关的信息，叫做链条法  你的第一段路径(练习N)\r#\r\r  1：围绕你的住所设计一个由12个记忆桩组成的路径\n  2: 在大脑中反复重复这条路径，直到你烂熟于心。如果可能，你甚至可以亲自走一趟\n  3:确定自己很熟悉这条路径之后，你可以用我前面提到的方法记住12件物品(蛋糕、马、报纸、水壶、鞭子、加农炮、香蕉、电话、猫王、天文望远镜、钟、咖啡)。你的想象要尽量鲜活\u0026ndash;记住，你可以动用逻辑、创造性，以及你所有的感官和情绪。\n  4: 接着盖着清单，看看你能按照正确的顺序记住多少。\n  5:顺序倒过来呢?\n  "}),a.add({id:8,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E5%86%A5%E6%83%B3/',title:"冥想",section:"自我提升",content:"冥想\r#\r\r呼吸冥想法\r#\r\r  1:坐好，后背挺直，然后闭上眼睛\n  2:关注你自己呼吸时的感觉,吸气，吸气，选择一个感受突出的地方，通常是你的鼻子或者耳朵、腹部然后集中注意力，关注你自己呼吸时的感觉。吸气，吸气，用嘴呼吸（最好关注腹部，因为我们大部分人都是腹部呼吸法）\n  3:一旦你开始这样做了脑子会乱想,你需要关注你到什么时候走神的，那么走神后重新调整后重新开始集中注意力开始冥想。\n  "}),a.add({id:9,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/dnf%E6%B1%A1%E6%9F%93/',title:"DNS 污染",section:"解决问题",content:"中国国内访问 GitHub 为什么很慢很卡甚至访问不了？如何加速访问 GitHub 网站？\r#\r\r个人总结：强扭的瓜不甜，修改 hosts 也就片刻好光景，要不了多久就变得比没改 hosts 之前更慢。所以还是顺其自然就好，不要白费力气去修改 hosts。\r#\r\r  摘要\n  网站分发加速网络的域名遭到 DNS 污染，DNS 不能直接找到那个最快的 IP！ 通过修改系统 hosts 文件的办法，绕过国内 DNS 解析，直接访问 GitHub 的 CDN 节点，从而达到加速的目的！\n  如何检验效果\n  操作之前先 ping 一下 github.com，两个请求超时，两个 93ms。\n  操作之后再 ping 一下 github.com，没有丢失，四个 287ms。\n  一、国内访问 GitHub 为什么很慢？\r#\r\r GitHub 的 CDN 域名遭到 DNS 污染，导致无法连接使用 GitHub 的加速分发服务器，才使得国内访问速度很慢。  二、如何解决 DNS 污染？\r#\r\r 通过修改 Hosts 文件，将域名解析直接指向 IP 地址来绕过 DNS 的解析，以此解决污染问题。  三、具体操作步骤\r#\r\r  1、打开 https://www.ipaddress.com/ 这个全球最好的 IP 地址查询工具网站来查询出域名当前对应的最优 IP。（不要用 ip168.com 这类国内的 IP 探针，其获取的国外域名的 ip 也是被 DNS 污染过的）\n  查询下面 3 个网址对应的 IP 地址\n  github.com : 140.82.113.4\n  assets-cdn.github.com : 185.199.108.153 185.199.109.153 185.199.110.153 185.199.111.153\n  github.global.ssl.fastly.net : 199.232.69.194\n  2、修改本地电脑系统 hosts 文件\n  Windows 系统中的文件路径： C:\\WINDOWS\\system32\\drivers\\etc\n  Linux 系统中的文件路径 /etc/hosts\n  直接在最后面加入以下代码\n  192.30.253.112 github.com\r140.82.113.4 github.com\r185.199.108.153 assets-cdn.github.com\r199.232.69.194 github.global.ssl.fastly.net\r 说明：在 Windows 系统中，包括 XP、Win7、Win8 、Win10 系统中，hosts 文件的位置都是一样的。如果 etc 文件夹中并没有 hosts 文件，那么可能是该文件隐藏了，可以设置一下，让其显示出来即可。\n   3、 更新dns缓存\n  修改后会直接生效，无需刷新 DNS 缓存，因为 hosts 的优先级大于 DNS 域名解析，添加完 hosts 之后，再访问对应的域名，已经就与 DNS 没关系了。如果未生效，重启操作系统或用命令刷新。\n  Windows 系统：ipconfig /flushdns\n  Linux 系统：systemctl restart nscd\n  Mac 系统：sudo dscacheutil -flushcache或sudo killall -HUP mDNSResponder\n  "}),a.add({id:10,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/githubpages%E7%BB%91%E5%AE%9A%E6%9D%A5%E8%87%AA%E9%98%BF%E9%87%8C%E4%BA%91%E7%9A%84%E5%9F%9F%E5%90%8D/',title:"GitHubPages绑定来自阿里云的域名",section:"解决问题",content:"  原教程但是由于他使用的github的用户名做的域名映射器,这样不好的地方是有可能你使用自定义的方式建立github仓库名比如 English study,还有一个是他使用的阿里云的域名映射解析这些是老版本的\n  GitHub Pages 绑定来自阿里云的域名==原博客教程\n  我的使用\r#\r\rgithub url ==\u0026gt; https://github.com/noatnu/studyDoc , 买的域名 http://www.zhouchenghua.com/\r#\r\r 解析第一个设置   创建A记录，请将您的顶点域指向GitHub Pages的IP地址 https 解析ip,上面的192.30.252.153是http解析方式现在官方已经宣布过时了,选择下面任意一个都可以  185.199.108.153\r185.199.109.153\r185.199.110.153\r185.199.111.153\r 解析第二个设置    github 要做的事\n  创建 CNAME文件,写入www.zhouchenghua.com\n   这个是我设置github project 设置截图   ping 地址  C:\\Users\\noatn\u0026gt;ping www.github.com\r正在 Ping github.com [13.250.177.223] 具有 32 字节的数据:\r请求超时。\r请求超时。\r请求超时。\r请求超时。\r13.250.177.223 的 Ping 统计信息:\r数据包: 已发送 = 4，已接收 = 0，丢失 = 4 (100% 丢失)，\rC:\\Users\\noatn\u0026gt;ping www.github.com.noatnu.studyDoc\r正在 Ping www.github.com.noatnu.studyDoc [223.87.179.156] 具有 32 字节的数据:\r来自 223.87.179.156 的回复: 字节=32 时间=872ms TTL=54\r来自 223.87.179.156 的回复: 字节=32 时间=10ms TTL=54\r来自 223.87.179.156 的回复: 字节=32 时间=7ms TTL=54\r来自 223.87.179.156 的回复: 字节=32 时间=8ms TTL=54\r223.87.179.156 的 Ping 统计信息:\r数据包: 已发送 = 4，已接收 = 4，丢失 = 0 (0% 丢失)，\r往返行程的估计时间(以毫秒为单位):\r最短 = 7ms，最长 = 872ms，平均 = 224ms\r  223.87.179.156这是我的静态博客地址 223.87.179.156\n  192.30.252.153 还可以改为223.87.179.156 ,不过不建议改 因为我们自己查出的ip不是固定ip 而 92.30.252.153是Github Pages服务器指定的IP地址，访问该IP地址即表示访问Github Pages\n  现在ipv4已经分配完了,虽然北美，日本，欧洲，韩国，香港等地的企业商 还有ipv4申请但是其实是他们以前申请保留下来的\n  按照我上面的截图设置即可 ,然后把我的github project url 下载下来看一下\n  所以设置完毕会等一段时间,大概至少会超过1个小时,因为这里面牵扯到阿里云的解析是否解析了你的域名映射,当然这不包括你的域名购买时间，注册以及实名认证这些时间,虽然官方说的时间是挺短的,当你做这些才会一声叹息啊\n  "}),a.add({id:11,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/git_andsower/git%E5%A4%84%E7%90%86/',title:"git处理网络和权限问题",section:"git出现的问题",content:" Push master to origin/master was rejected by remote  有三种原因\r1:push的这个工程是其他人新建的，找她开通master权限后，再次push\r2:git 工程错误\rgit pull\rgit pull origin master\rgit pull origin master --allow-unrelated-histories\r3:github 设置原因\r勾选了Keep my email addresses private\r解决办法2种\r第一种 通知账户人员取消勾选\r第二种\r重新设置你的全局用户E-mail\rgit config --list 查看这个时候一定不对\r因此重新设置全局email\r重置上次提交的作者信息 git commit --amend --reset-author\rgit config --global user.name \u0026quot;zch\u0026quot;\rgit config --global user.email \u0026quot;sdhshd@163.com\u0026quot;\rok\r对了你如果使用的不是idea而是git\r那么抛出的错误非常明显\r如果抛出\rgit报错--\u0026gt;! [remote rejected] master -\u0026gt; master (push declined due to email privacy restrictions)\r那么一定是这个原因\r git clone时报RPC failed; curl 18 transfer closed with outstanding read data remaining 错误  原因1：缓存区溢出\rgit config http.postBuffer 524288000\r执行上面命令如果依旧clone失败，考虑可能原因2：网络下载速度缓慢\r解决方法：命令行输入\rgit config --global http.lowSpeedLimit 0\rgit config --global http.lowSpeedTime 999999\r如果依旧clone失败，则首先浅层clone，然后更新远程库到本地\rgit clone --depth=1 http://gitlab.xxx.cn/yyy/zzz.git\rgit fetch --unshallow\r error: RPC failed； curl 28 OpenSSL SSL_read: Connection was reset, errno 10054 fatal: expected  git config --global http.sslVerify \u0026quot;false\u0026quot;\r  Failed to connect to 127.0.0.1 port 1080: Connection refused\n  这是由于设置了动态代理(最好下面方法都试一遍\u0026hellip;因为可能设置了不只一次o(╥﹏╥)o);\n  git查看\n  查询动态代理\rgit config --global http.proxy\rgit config --global https.proxy\r 若是有返回值  取消代理\rgit config --global --unset http.proxy\rgit config --global --unset httpx.proxy\r  git配置文件查看 打开c:\\Users\\当前用户里的.gitconfig文件(这个默认是隐藏文件), 将里面关于proxy的行删掉\n  环境变量查看 打开环境变量,查看查看用户变量和系统变量(两个都要看\u0026hellip;.我就是两个都设置了o(╥﹏╥)o),将里面的http_proxy(也可能不是这个名字,但是看值是127.0.0.1:1080这种的就是了,或者有proxy),把这一行删掉就行\n  Failed to connect to github.com port 443: Timed out\n  D:\\IdeaProjects\\motorcycle\u0026gt;git config --global --unset http.proxy\rD:\\IdeaProjects\\motorcycle\u0026gt;git config --global --unset https.proxy\rD:\\IdeaProjects\\motorcycle\u0026gt;\r  remote: HTTP Basic:Access denied fatal:Authentication failed for\n  最终解决方法，控制面板 \u0026gt; 用户账户\n   然后找到 凭据管理器 选择Windows凭据   如图删除掉之前使用者留下的 凭据再次执行pull 就会弹出一个对话框来让你输入该 仓库的用户名和密码了  "}),a.add({id:12,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/idea/idea/',title:"idea 解决working directory 设置到 target",section:"idea出现的问题",content:" idea 解决working directory 设置到 target  test ng D:\\IdeaProjects\\java-se-study\rrun config $MODULE_DIR$\r"}),a.add({id:13,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/maven/idea%E8%A7%A3%E5%86%B3/',title:"idea 问题解决",section:"maven出现的问题",content:" idea导入项目出现Unable to import maven project: See logs for details提示\n 第一种解决办法\r#\r\r  删除项目根目录下.idea文件夹\n  关闭idea工具，重新打开选择File-\u0026gt;New-\u0026gt;Project from the existing source ,选择刚才的项目根目，下一步：\n  一直点next，最后点击主工程的pom.xml 完成！\n  第二种\r#\r\r  打开idea 的日志文件如果发现【Error】com.google.inject.CreationException: Unable to create injector\n  那么自定义配置Maven3.6.2报错 或者更高版本maven\n  原因：Maven3.6.2的版本兼容问题。\n  解决方法：重新下载较低版本Maven3.6.1及以下版本可以顺利解决。\n  用maven无论是新建项目还是导入没有下载到本地仓库的jar。出现了Unable to import maven project\n  打开cmd，ping localhost，显示一般故障\n  在左边控制栏，关闭防火墙，再开启防火墙 再次ping localhost，成功\n  对了 假如出现文件权限问题 那么更改maven的本地仓库地址\n  "}),a.add({id:14,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%A7%A3%E5%86%B3%E9%97%AE%E9%A2%98/visual_studio_code/visualstudiocode%E9%97%AE%E9%A2%98/',title:"Visual Studio Code 问题解决方案",section:"visual_studio_code",content:"Visual Studio Code 过滤文件 不显示某些文件\r#\r\r效果\r#\r\r 过滤工程中显示的文件 不显示某些类型的文件或文件夹  菜单\r#\r\r File/Preferences/ 搜索file exclude 选中workspack页签 添加一个过滤规则 如图:   "}),a.add({id:15,href:'/lifeDoc/docs/%E8%87%AA%E6%88%91%E6%8F%90%E5%8D%87/%E8%8E%B7%E5%8F%96%E9%87%91%E9%92%B1/%E5%A6%82%E4%BD%95%E5%9C%A8%E6%B2%B9%E7%AE%A1youtube%E5%BC%80%E9%80%9A%E6%94%B6%E7%9B%8A%E8%B5%9A%E9%92%B1/',title:"如何在油管YouTube开通收益赚钱",section:"获取金钱",content:"如何在油管YouTube开通收益赚钱？\r#\r\r如果想在YouTube创业赚取美金，建议关注【YouTube运营笔记】，少走弯路，不被忽悠\n本篇主要由3个常见问题详细展开：\r#\r\r 如何在油管上开通获利？ 油管广告收益情况如何？ 油管除了广告还能怎么赚钱？  一、如何在YouTube开通获利？\r#\r\r第1步：你得有一个Gmail账号\r#\r\r YouTube账号是跟谷歌邮箱账号是关联的。想创建频道然后上传视频的基础条件就是，注册并登陆谷歌账号，目前一些国内手机注册会失败。   注：Gmail能登录就行，手机号码归属和注册地对后期收益不存在影响。\n 第2步：你得有一个YouTube频道\r#\r\r 一般而言只要你有了谷歌账号，就默认有一个YouTube频道了，但那个频道名称头像是跟谷歌邮箱是挂钩的，建议单独创建频道。此外，一个谷歌账号是创建多个频道的。   注：创建频道前，要想清楚频道的内容定位；频道创建后，还要对频道进行装修。\n 第3步：你得有策略地上传视频\r#\r\r 这一步非常重要，YouTube运营是一个技术活，不是随随便便发几个视频就有人看，也不是坚持发布就能做起来。有志要做的建议查看本专栏的其它文章，这里不细讲。   注：做YouTube成功的条件是「优质的内容+正确的方法」，缺一不可\n 第4步（重点）：你须达到获利门槛/申请开通\r#\r\r 想开通获利，必须满足以下条件：   1:选择支持YouTube合作伙伴计划的国家或地区。 2:12 个月内的有效观看时长累计超过4000小时。 3:频道拥有至少1000订阅。 4:拥有可关联的 AdSense 帐号。   其中，最为关键的同时最难的条件是4000小时和1000名订阅；「国家/地区」后台设置支持的国家/地区即可；「AdSense」是在频道达到获利门槛后显示注册入口，看似简单却最容易出错，资料要仔细填写，一旦填错后续非常麻烦。《YouTube运营新手最常踩5大坑，最后1个最坑人！》 除了订阅者数量和观看次数要求外，还有内容要求。获利申请的审核是官方人工审核，如果审核者认为频道或视频不符合条件，也是容易无法通过的，审核时间快则一两天，慢的一个多月也有。《YouTube获利政策：这11类内容没有收益》  二、油管广告收益情况如何？\r#\r\r YouTube将部分广告收入（55%）分给相应的Youtuber，就能构成一个良性循环的三赢局面：广告商得到宣传，Youtuber赚钱，油管平台赚钱同时有源源不断的优质内容创作出来。平台把55%的广告收益分给视频创作者，这对自媒体从业者而言，真不算低。    YouTube的千次播放（CPM）的收益差距略大，一般在1-10美元不等。影响视频收益主要因素包括：\n  1:观看地区：发达国家cpm远高于发展中国家，如果你的观众主要来自发达国家收益则更高。\n  2:频道领域：某些领域的内容有更高的CPM，比如数码、经济类就相对高。\n  3:视频时长：超过8分钟的视频，可以无限插入广告，收益更多。\n  4:频道/视频：频道或者某个视频比较优质的，会获得更多优质广告展示。\n  另外，还会受其他重大事件影响，比如2020年受疫情影响，大部分频道的CPM大幅下跌。《新冠疫情对YouTube影响有多大？2020多数频道单价下跌20%以上》\n  三、油管除了广告还能怎么赚钱？\r#\r\r  在油管做内容，广告收益是基本的收入保障，不过大部分YouTuber不会满足于只要广告收入。\n  油管除了一般广告收益方式，还有其他的变现方式。官方提供的变现方法还有：频道会员、商品搁架、超级留言和超级贴纸、YouTube Premium。这些功能需要较高的条件，同时收益不算太高。但自媒体变现总的而言离不开3大变现方式：广告、带货和打赏。\n    此外，国内常用的一些变现方法，在油管也是通用的，常见的有：\n  亚马逊联盟行销：类似国内的淘宝联盟，你帮商家带货后获取一定的佣金。\n  品牌合作推广：频道内容做得好，流量也够多，总会有商家来邀请你合作，这种方式的收益是比较高的。\n  电商带货：不同于联盟行销，联盟行销是帮别人卖自己拿佣金，而自己开店就可以获得更高的利润，当然也得投入更多的资源。\n  粉丝经济：如果你频道的粉丝粘度比较高，可以考虑做依靠粉丝赞助或者粉丝付费，此外目前兴起的直播打赏也是不错的变现方法。\n    这些是比较常见的变现方法，其实变现方法远不止这些。但是能否变现，能否获得更多的收益，其实核心还是靠内容：内容优质，流量多，那怎么变现都可以。\n  最后还想说，如果想在油管创业，最好把眼光放长远同时专心做好内容。做内容是一方面，油管还有很多旁门左道，赚大钱的自媒体团队往往不走寻常路，在此就不宜公开了。\n  如果想在YouTube创业赚钱，建议关注专栏【YouTube运营笔记】，少走弯路，不被忽悠。\n  YouTube闭坑指南：\n  文兄：90%新人必犯的7个错误\n  李大卫：YouTube收益开启全指南\n  文兄：10个错误导致99%频道走向失败\n  迷死任：YouTuber必了解Youtube审核机制\n  文兄：YouTube运营，新手最常踩5大坑！\n  文兄：油管获利政策：这11类内容无收益\n  文兄：YouTube互粉？别把频道玩坏了！\n  文兄：YouTube搬运赚钱？没那么简单\n  文兄：如何在YouTube开通收益赚钱？\n  YouTube运营攻略：\n  文兄：YouTube新频道如何快速涨粉？\n  李大卫：油管什么样的视频最多人看？\n  迷死任：爆款攻略：详解YouTube算法\n  文兄：Youtuber必备的12个网站（全）\n  李大卫：3个营销工具运营效果事半功倍\n  文兄：最全YouTube视频SEO 优化技巧\n  文兄：油管起标题6技巧，打造百万爆款\n  "}),a.add({id:16,href:'/lifeDoc/docs/hugo%E5%AD%A6%E4%B9%A0/',title:"hugo教程",section:"Docs",content:"hugo学习\n"}),a.add({id:17,href:'/lifeDoc/docs/hugo%E5%AD%A6%E4%B9%A0/hugo_server_faile_-to_get_json/',title:"hugo教程 hugo server Failed to get JSON",section:"hugo教程",content:" 今天尝试了一下静态博客 hugo , hugo的官网本身也是使用 hugo 制作的网站。安装和运行非常简单。只有两个步骤安装和运行。运行的时候出现了一个小问题，就是由于网络的原因不能启动成功。\n 粗暴的禁用网络连接相关的操作\r#\r\r 就是两个 短代码 给删除了 instagram, tweet。  find . -name \u0026amp;quot;*.md\u0026amp;quot; | xargs sed -i \u0026amp;#x27;/{{\u0026amp;lt; instagram/cinstagram content\u0026amp;#x27;\rfind . -name \u0026amp;quot;*.md\u0026amp;quot; | xargs sed -i \u0026amp;#x27;/{{\u0026amp;lt; tweet/ctwitter content\u0026amp;#x27;\rhugo server --bind \u0026amp;#x27;0.0.0.0\u0026amp;#x27;\r print code  ERROR 2021/03/06 09:55:20 Failed to get JSON resource \u0026quot;https://api.twitter.com/1/statuses/oembed.json?id=877500564405444608\u0026amp;dnt=false\u0026quot;: Get \u0026quot;https://api.twitter.com/1/statuses/oembed.json?id=877500564405444608\u0026amp;dnt=false\u0026quot;: dial tcp 31.13.91.33:443: connectex: A connection attempt failed because the connected party did not properly respond after a period of time, or established connection failed because connected host has failed to respond.\rIf you feel that this should not be logged as an ERROR, you can ignore it by adding this to your site config:\rignoreErrors = [\u0026quot;error-remote-getjson\u0026quot;]\rBuilt in 21188 ms\rError: Error building site: logged 1 error(s)\r"}),a.add({id:18,href:'/lifeDoc/docs/hugo%E5%AD%A6%E4%B9%A0/hugo_tutorials1/',title:"hugo教程1",section:"hugo教程",content:"教程1\r#\r\r快速开始\r#\r\r 步骤1：安装Hugo  brew install hugo\r# or\rport install hugo\r 要验证新安装  hugo version\r 步骤2：建立新网站  hugo new site quickstart\r# 上面的代码将在名为的文件夹中创建一个新的Hugo网站quickstart。\r 步骤3：添加主题  # 首先，从GitHub下载主题并将其添加到您站点的themes目录中：\rcd quickstart\rgit init\rgit submodule add https://github.com/budparr/gohugo-theme-ananke.git themes/ananke\r 然后，将主题添加到站点配置中：  echo 'theme = \u0026quot;ananke\u0026quot;' \u0026gt;\u0026gt; config.toml\r 步骤4：添加一些内容  hugo new posts/my-first-post.md\r 如果需要，请编辑新创建的内容文件，该文件将从以下内容开始：   ---\rtitle: \u0026quot;My First Post\u0026quot;\rdate: 2019-03-26T08:47:11+01:00\rdraft: true\r---\r 步骤5：启动Hugo服务器  ▶ hugo server -D\r| EN\r+------------------+----+\rPages | 10\rPaginator pages | 0\rNon-page files | 0\rStatic files | 3\rProcessed images | 0\rAliases | 1\rSitemaps | 1\rCleaned | 0\rTotal in 11 ms\rWatching for changes in /Users/bep/quickstart/{content,data,layouts,static,themes}\rWatching for config changes in /Users/bep/quickstart/config.toml\rEnvironment: \u0026quot;development\u0026quot;\rServing pages from memory\rRunning in Fast Render Mode. For full rebuilds on change: hugo server --disableFastRender\rWeb Server is available at http://localhost:1313/ (bind address 127.0.0.1)\rPress Ctrl+C to stop\r 步骤7：建立静态页面  hugo -D\r./public/默认情况下，输出将位于目录中（-d/--destination标志进行更改，或publishdir在配置文件中设置）\r"}),a.add({id:19,href:'/lifeDoc/docs/hugo%E5%AD%A6%E4%B9%A0/hugo_tutorials2/',title:"hugo教程2",section:"hugo教程",content:"教程2\r#\r\r 1、	创建blog  hugo new site myblog_pub\rcd myblog_pub/\rgit submodule add https://github.com/chinanf-boy/gohugo-theme-yinwang.git themes/yinwang\r  2、	修改配置\n  vi config.toml\n  root@instance-x8rtph4n:/home/go/code/hugo_dir/myblog_pub/public# more ../config.toml baseURL = \u0026quot;http://ypbsyy.github.io/\u0026quot;\rlanguageCode = \u0026quot;en-us\u0026quot;\rtitle = \u0026quot;我是yaopeng\u0026quot;\rtheme = \u0026quot;yinwang\u0026quot;\r#pygmentsCodeFences = true\r#pygmentsCodefencesGuessSyntax = false\r#pygmentsStyle = \u0026quot;dracula\u0026quot;\r#pygmentsOptions = ['linenos']\r# 代码高亮/chroma，hugo默认自带\r[params]\rauthor = \u0026quot;yaopeng\u0026quot;\rgithub = \u0026quot;yaopeng\u0026quot;\r# gitlab = \u0026quot;yobrave\u0026quot;\r#googleAnalytics = \u0026quot;****\u0026quot;\r# 谷歌统计gtag\rhighlight = \u0026quot;dracula\u0026quot; # 默认样式 `github`\rlangs = [\u0026quot;go\u0026quot;]\r# 默认加载 highlight.min.js，但 一些不支持的语言, 你自己添加,\r# 其实也可以使用hugo自带的语法高亮器设置，不过我有点懒\r# single = false\r# 单页面的Home 按钮去除\r# menus = true\r# 我 想加更多目录\r# backgroundColor = \u0026quot;#fbf6ec\u0026quot;\r加点黄黄的背景色\r#\r\r  3、	创建github\n  4、	部署到github\n  git submodule init\rgit submodule update\rhugo --buildDrafts\rcd public/\rgit init\rgit remote rm origin git remote add origin https://github.com/ypbsyy/ypbsyy.github.io.git\rgit add -A\rgit commit -m \u0026quot;first commit\u0026quot;\rgit push -u origin master\r这里面实际到hugo –buildDrafts 这里就ok 剩余的是把public中的html传入静态网页中\r 注意文章开头必须有这几个   ---\rtitle: \u0026quot;My First Post\u0026quot;\rdate: 2019-03-26T08:47:11+01:00\rdraft: true\r---\r  baseURL = \u0026ldquo;https://swagcode-io.github.io/demo\u0026quot;\n  这里的url是自己对应的\n  git submodule add https://github.com/chinanf-boy/gohugo-theme-yinwang.git themes/yinwang\n  下载主题\n  参考网址\n  https://www.pianshen.com/article/1216214802/\n  https://zhuanlan.zhihu.com/p/105021100?utm_source=weibo\n  https://zhuanlan.zhihu.com/p/105021100?utm_source=weibo\n  "}),a.add({id:20,href:'/lifeDoc/posts/uml/',title:"统一建模语言",section:"Blog",content:" 统一建模语言(Unified Modeling Language，UML)是一种为面向对象系统的产品进行说明、可视化和编制文档的一种标准语言，是非专利的第三代建模和规约语言。UML是面向对象设计的建模工具，独立于任何具体程序设计语言。\n UML作为一种统一的软件建模语言具有广泛的建模能力。UML是在消化、吸收、提炼至今存在的所有软件建模语言的基础上提出的，集百家之所长，它是软件建模语言的集大成者。UML还突破了软件的限制，广泛吸收了其他领域的建模方法，并根据建模的一般原理，结合了软件的特点，因此具有坚实的理论基础和广泛性。UML不仅可以用于软件建模，还可以用于其他领域的建模工作。 [1]\r#\r\rUML立足于对事物的实体、性质、关系、结构、状态和动态变化过程的全程描述和反映。UML可以从不同角度描述人们所观察到的软件视图，也可以描述在不同开发阶段中的软件的形态。UML可以建立需求模型、逻辑模型、设计模型和实现模型等，但UML在建立领域模型方面存在不足，需要进行补充。 [1]\r#\r\r作为一种建模语言，UML有严格的语法和语义规范。UML建立在元模型理论基础上，包括4层元模型结构，分别是基元模型、元模型、模型和用户对象。4层结构层层抽象，下一层是上一层的实例。UML中的所有概念和要素均有严格的语义规范。 [1]\r#\r\rUML采用一组图形符号来描述软件模型，这些图形符号具有简单、直观和规范的特点，开发人员学习和掌握起来比较简单。所描述的软件模型，可以直观地理解和阅读，由于具有规范性，所以能够保证模型的准确、一致。\r#\r\r"}),a.add({id:21,href:'/lifeDoc/posts/project-management/',title:"项目管理",section:"Blog",content:"项目管理（Project Management,PM/Management by Projects,MBP）\r#\r\r项目管理概述\r#\r\r###　项目管理是项目的管理者，在有限的资源约束下，运用系统的观点、方法和理论，对项目涉及的全部工作进行有效地管理。即从项目的投资决策开始到项目结束的全过程进行计划、组织、指挥、协调、控制和评价，以实现项目的目标。\n###　按照传统的做法，当企业设定了一个项目后，参与这个项目的至少会有好几个部门，包括财务部门、市场部门、行政部门等等，而不同部门在运作项目过程中不可避免地会产生摩擦，须进行协调，而这些无疑会增加项目的成本，影响项目实施的效率。\n###　而项目管理的做法则不同。不同职能部门的成员因为某一个项目而组成团队，项目经理则是项目团队的领导者，他们所肩负的责任就是领导他的团队准时、优质地完成全部工作，在不超出预算的情况下实现项目目标。项目的管理者不仅仅是项目执行者，他参与项目的需求确定、项目选择、计划直至收尾的全过程，并在时间、成本、质量、风险、合同、采购、人力资源等各个方面对项目进行全方位的管理，因此项目管理可以帮助企业处理需要跨领域解决的复杂问题，并实现更高的运营效率。\n###　项目管理的应用从80年代仅限于建筑、国防、航天等行业迅速发展到今天的计算机、电子通讯、金融业甚至政府机关等众多领域。\n###　人们通常认为，项目管理是第二次世界大战的产物（如：曼哈顿计划）。在1950年至1980年期间，应用项目管理的主要是国防建设部门和建筑公司。传统的观点认为，项目管理者的工作就是单纯地完成既定的任务。\n###　从本世纪八十年代开始，项目管理的应用扩展到其他工业领域（行业），如制药行业、电信部门、软件开发业等。项目管理者也不再被认为仅仅是项目的执行者，要求他们能胜任其它各个领域的更为广泛的工作，同时具有一定的经营技巧。美国项目管理学会（PMI）已提出了关于一个有效的专业项目管理者必须具备的几个方面的基本能力：\n 项目范围管理 项目时间管理 项目费用管理 项目质量管理 项目人力资源管理 项目沟通管理 项目风险管理 项目采购管理 项目综合管理  "})})()